import React from 'react';

// third-party
import { FormattedMessage } from 'react-intl';

// assets
import { IconUsers, IconFiles, IconMessage } from '@tabler/icons';

// constant
const icons = { IconUsers, IconFiles, IconMessage };

// ===========================|| DASHBOARD MENU ITEMS ||=========================== //

const team = {
    id: 'team',
    title: <FormattedMessage id="team" />,
    type: 'group',
    children: [
        {
            id: 'loanOfficers',
            title: <FormattedMessage id="Loan Officers" />,
            type: 'item',
            url: '/loan-officers',
            icon: icons.IconUsers,
            breadcrumbs: false
        },
        {
            id: 'employeeFiles',
            title: <FormattedMessage id="Employee Files" />,
            type: 'item',
            url: '/employee-files',
            icon: icons.IconFiles,
            breadcrumbs: false
        },
        {
            id: 'chat',
            title: <FormattedMessage id="Chat" />,
            type: 'item',
            url: '/chat',
            icon: icons.IconMessage,
            breadcrumbs: false
        }
    ]
};

export default team;
